import Drawer from './Drawer'
import Tab from './Tab'

const Routes = () => {
  return (
    <SafeAreaView style={{flex: 1}}>
        <NavigationContainer>
            <Tab />
            {/* <Drawer /> */}
        </NavigationContainer>
    </SafeAreaView>
  )
}

export default Routes
